    in AB 1201 (2005). Work on the boundary was completed by CalFire, GreenInfo Network,
    and the California Department of Fish and Game. Meets and bounds description of
    the area as defined in statute: PRC Section 33302 (f) defines the Sierra Nevada
    Region as the area lying within the Counties of Alpine, Amador, Butte, Calaveras,
    El Dorado, Fresno, Inyo, Kern, Lassen, Madera, Mariposa, Modoc, Mono, Nevada, Placer,
    Plumas, Shasta, Sierra, Tehama, Tulare, Tuolumne, and Yuba, described as the area
    bounded as follows: On the east by the eastern boundary of the State of California;
    the crest of the White/Inyo ranges; and State Routes 395 and 14 south of Olancha;
    on the south by State Route 58, Tehachapi Creek, and Caliente Creek; on the west
